import React from "react";

function Search() {
  return (
    <>
    <div className="form-group">
      <input className="form-control" {...props} />
    </div>
    <button {...props} style={{ float: "right", marginBottom: 10 }} className="btn btn-success">
    {props.children}
    </button>
    </>
  );
}

export default Search;
